function Pricing() {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col-4'>
                    <h1>Unbeatable pricing</h1>
                </div>
                <div className='col-2'></div>
                <div className='col-6'></div>
            </div>
        </div>
     );
}

export default Pricing;
